import React from 'react';
import { Button, StyleSheet, TouchableOpacity, Text, View } from 'react-native';


const styles = {
    rectangle: {
        width: '239px',
        height: '57px',
    },
    appButtonContainer: {
    elevation: 8,
    borderRadius: 10,
    paddingVertical: 10,
    paddingHorizontal: 12
  	},
  	appButtonText: {
    fontSize: 18,
    color: "#fff",
    fontWeight: "bold",
    alignSelf: "center",
    textTransform: "uppercase"
  }
}

const AppButton = function ({ onPress, title }) {
return(
  <TouchableOpacity onPress={onPress} style={styles.appButtonContainer}>
    <Text style={styles.appButtonText}>{title}</Text>
  </TouchableOpacity>
)};

export { AppButton };
